import React, { useState, useEffect } from 'react';
import Axios from 'axios';
import Button from 'react-bootstrap/Button';
import Container from 'react-bootstrap/Container';
import Form from 'react-bootstrap/Form';
import Nav from 'react-bootstrap/Nav';
import Navbar from 'react-bootstrap/Navbar';
import NavDropdown from 'react-bootstrap/NavDropdown';


function RentalItem({ rental }) {
  return (
    <Col key={rental.id} md={4}>
      <Link to={`/rental/${rental.id}`} style={{ textDecoration: 'none' }}>
        <Card className="mb-4 shadow">
          <Card.Img src={rental.image_link} alt="Rental" style={{ height: '320px' }} />
          <Card.Body>
            <Card.Title>Vehicle Type: {rental.vehicle_type}</Card.Title>
            <Card.Text>Model: {rental.model}</Card.Text>
            <Card.Text>Price: {rental.price}</Card.Text>
          </Card.Body>
        </Card>
      </Link>
    </Col>
  );
}

function Rental() {
  const [rentals, setRentals] = useState([]);

  useEffect(() => {
    document.title = 'Rent';
    Axios.get('http://127.0.0.1:8000/api/rentals/')
      .then((response) => {
        setRentals(response.data);
      })
      .catch((error) => {
        console.error('Error fetching rental data:', error);
      });
  }, []);

  return (
    <div>
      <Navbar expand="lg" className="bg-body-tertiary" data-bs-theme="dark">
        <Container fluid>
          <Navbar.Brand href="http://localhost:3000">VehicleVerse</Navbar.Brand>
          <Navbar.Toggle aria-controls="vehicleverse" />
          <Navbar.Collapse id="vehicleverse">
            <Nav className="me-auto my-2 my-lg-0" style={{ maxHeight: '100px' }}>
              <Nav.Link href="http://localhost:3000">Home</Nav.Link>
              <Nav.Link href="http://localhost:3000/rental">Rent</Nav.Link>
              <NavDropdown title="POST" id="navbarScrollingDropdown">
                <NavDropdown.Item href="http://localhost:3000/sell/post">
                  ADD For Sell
                </NavDropdown.Item>
                <NavDropdown.Item href="http://localhost:3000/rent/post">
                  ADD For Rent
                </NavDropdown.Item>
              </NavDropdown>
            </Nav>
            <Form className="d-flex">
              <Form.Control
                type="search"
                placeholder="Search"
                className="me-2"
                aria-label="Search"
              />
              <Button className="me-2" variant="success">Search</Button>
            </Form>
            <Button variant="danger" href="http://127.0.0.1:8000/login/">Log Out</Button>
          </Navbar.Collapse>
        </Container>
      </Navbar>

      <Container className="mt-4">
        <h1 className="text-center">Vehicle List For Rent</h1>
        <Row>
          {rentals.map((rental) => (
            <RentalItem key={rental.id} rental={rental} />
          ))}
        </Row>
      </Container>
    </div>
  );
}

export default Rental;
